import base64
from pathlib import Path

# İkon dizinini oluştur
icons_dir = Path("icons")
icons_dir.mkdir(exist_ok=True)

# İkonlar için base64 kodları
icons = {
    "save": """
        
    """,
    "delete": """
        
    """,
    "edit": """
        
    """,
    "search": """
        
    """,
    "report": """
        
    """,
    "settings": """
        
    """,
    "backup": """
        
    """,
    "user": """
        
    """,
    "test": """
        
    """
}

# Her bir ikonu kaydet
for name, data in icons.items():
    # Base64 kodunu temizle
    data = data.strip().replace("\n", "").replace(" ", "")
    
    # Base64'ten binary'ye çevir
    binary_data = base64.b64decode(data)
    
    # Dosyaya kaydet
    with open(icons_dir / f"{name}.png", "wb") as f:
        f.write(binary_data) 